import React from 'react';

class Square extends React.Component {
  constructor(props) {
    super(props);
    this.handler = () => {
      console.log('test');
    }
  }
  render() {
    return (
      <button onClick={this.handler}>
        test {this.props.name}
      </button>
    );
  }
}

export default Square;
